script: |
  super -f text -I q13625.spq | sort > q13625.out

inputs:
  - name: q13625.spq
    data: |
      SELECT col0 / col2 - + - col1 FROM tab2 (FORMAT parquet) WHERE - col2 NOT IN ( + col0, - col2 * - col1 - col1 * - 68 );
  - name: tab2

outputs:
  - name: q13625.out
    data: |
      53
      68
      78
